"use strict";

const accumulate = (arr) => {
  let sum = 0;
  return arr.map((val) => (sum += val));
};

const f_gold = (stones) => {
  const pre_sum = accumulate(stones);
  let f = pre_sum[stones.length - 1];
  for (let i = stones.length - 2; i > 0; i--) {
    f = Math.max(f, pre_sum[i] - f);
  }
  return f;
};
